import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './Dashboard.css';

const PartnerDashboard = () => {
    const [leads, setLeads] = useState([]);
    const [newLead, setNewLead] = useState({
        name: '',
        email: '',
        phone_number: '',
        company: '',
        description: '',
    });
    const [loading, setLoading] = useState(false);

    // Fetching leads from the API
    useEffect(() => {
        const fetchLeads = async () => {
            setLoading(true);
            try {
                const response = await axios.get('http://localhost:8000/api/leads/', {
                    headers: { Authorization: `Token ${localStorage.getItem('token')}` },
                });
                setLeads(response.data);
            } catch (error) {
                console.error('Error fetching leads:', error);
            } finally {
                setLoading(false);
            }
        };
        fetchLeads();
    }, []);

    // Handle input field changes
    const handleInputChange = (e) => {
        setNewLead({ ...newLead, [e.target.name]: e.target.value });
    };

    // Handle form submission
    const handleSubmit = async (e) => {
        e.preventDefault();
        setLoading(true);
        
        // Directly using newLead as leadData
        const leadData = { ...newLead, status: 'Pending' };

        try {
            // Submit the lead to the backend
            await axios.post('http://localhost:8000/api/leads/', leadData, {
                headers: { Authorization: `Token ${localStorage.getItem('token')}` },
            });
            // Send email notification to admin (assuming you have a backend to handle this)
            await axios.post('http://localhost:8000/api/send-lead-email/', leadData, {
                headers: { Authorization: `Token ${localStorage.getItem('token')}` },
            });

            alert('Lead submitted successfully!');
            setNewLead({ name: '', email: '', phone_number: '', company: '', description: '' });
            // Refresh leads after submission
            fetchLeads();
        } catch (error) {
            console.error('Error submitting lead:', error);
            alert('Error submitting lead');
        } finally {
            setLoading(false);
        }
    };

    // Reset the form fields
    const handleReset = () => {
        setNewLead({ name: '', email: '', phone_number: '', company: '', description: '' });
    };

    return (
        <div className="dashboard">
            <h1>Partner Dashboard</h1>
            <form className="lead-form" onSubmit={handleSubmit}>
                <input
                    name="name"
                    placeholder="Name"
                    onChange={handleInputChange}
                    value={newLead.name}
                    required
                />
                <input
                    name="email"
                    placeholder="Email"
                    type="email"
                    onChange={handleInputChange}
                    value={newLead.email}
                    required
                />
                <input
                    name="phone_number"
                    placeholder="Phone Number"
                    onChange={handleInputChange}
                    value={newLead.phone_number}
                    required
                />
                <input
                    name="company"
                    placeholder="Company"
                    onChange={handleInputChange}
                    value={newLead.company}
                    required
                />
                <textarea
                    name="description"
                    placeholder="Lead Details"
                    onChange={handleInputChange}
                    value={newLead.description}
                    required
                />
                <button type="submit" disabled={loading}>
                    {loading ? 'Submitting...' : 'Submit'}
                </button>
                <button type="button" onClick={handleReset}>Reset</button>
            </form>

            {loading ? (
                <p>Loading leads...</p>
            ) : (
                <>
                    <h2>Your Leads</h2>
                    <table>
                        <thead>
                            <tr>
                                <th>Name</th>
                                <th>Email</th>
                                <th>Phone</th>
                                <th>Company</th>
                                <th>Status</th>
                            </tr>
                        </thead>
                        <tbody>
                            {leads.map((lead) => (
                                <tr key={lead.id}>
                                    <td>{lead.name}</td>
                                    <td>{lead.email}</td>
                                    <td>{lead.phone_number}</td>
                                    <td>{lead.company}</td>
                                    <td>{lead.status}</td>
                                </tr>
                            ))}
                        </tbody>
                    </table>
                </>
            )}
        </div>
    );
};

export default PartnerDashboard;
